static public Program gProgram = null;
static public DateTime bootTime;
public Program()
{
	gProgram = this;
	resourceLoader = new ResourceLoader();
	resourceLoader.p = this;
	bootTime = DateTime.Now;

	log("BOOT", LT.LOG_N);
	//Config = new Config_();
